(function() {
    window.addEventListener("load", function() {
        setTimeout(function() {
            // Section 01 - Set url link 
            var logo = document.getElementsByClassName('link');
            logo[0].href = "#";
            logo[0].target = "_blank";

            // Section 02 - Set logo
            logo[0].children[0].alt = "Hemprit";
            logo[0].children[0].src = "data:image/png;base64,";

            //// Section 03 - Set 32x32 favicon
            var linkIcon32 = document.createElement('link');
            linkIcon32.type = 'image/png';
            linkIcon32.rel = 'icon';
            linkIcon32.href = 'data:image/png;base64,';
            linkIcon32.sizes = '32x32';
            document.getElementsByTagName('head')[0].appendChild(linkIcon32);
            document.title = "Billing Application Apis";
        });
    });
})();